How to get the unread count<p>I created my message schema as following:-</p>

<pre><code>{ 
_id : message_unique_id,
recipients : [ user_id1,user_id2,user_id3 ],
message : "Hello Word",
readBy : [user_id2,user_id3],
chatId : unique_id_for_every_chat
}
</code></pre>

<p>Now i am able to get the last message of each conversation, but not able to get the count of unread messages. What i am using is as following:-</p>

<pre><code>Messages.aggregate([
{ $match : {recipients : {$in : [my_user_id]},
{ $project : {
chatId : 1,
recipients : 1,
readBy : 1
}, { $group : {
_id : "$chatId",
message : "$last" : "$message"} }}]).exec();
</code></pre>

<p>The above query works good and return the last message of each chat done by the user. But now i want to get the unread message count too. I used the following query:-</p>

<pre><code>Messages.aggregate([
    { $match : {recipients : {$in : [my_user_id]},
    { $project : {
    chatId : 1,
    recipients : 1,
    readBy : 1,
    unread: {  
            $cond: { if : { "$readBy" : {$in : [my_user_id]}}, then : 
            0, else : 1 }
        }
    }, 
    { $group : {
          _id : "$chatId",
           unreadCount : { $sum: "$unread" },   
           message : "$last" : "$message"} }}]).exec();
</code></pre>

<p>But this query returns null. Please help.</p>

