Blocked by CORS policy error when calling to mongo/golang db with angular web app<p>I'm making a web app with angular on the frontend, and golang and mongo on the backend for the database.
I have the db up and running, and all route requests have been tested and are working on Postman.
However, when I try to make DELETE request or PUT request on the service of the angular app, I get hit with the following error:</p>

<p>"Access to XMLHttpRequest at '-my api url-' from origin '<a href="http://localhost:4200" rel="nofollow noreferrer">http://localhost:4200</a>' has been blocked by CORS policy: Response to preflight request doesn't pass access control check: No 'Access-Control-Allow-Origin' header is present on the requested resource."</p>

<p>I can make GET and POST requests, but not DELETE or PUT.</p>

<p>How do I get around this? Is this a frontend issue, or backend? Any help will be appreciated. Thank you.</p>

<p>PS: I'm using mongoHandlers.</p>

<p>Here's my service on the front end:</p>

<pre><code>deleteShow(showId: string) {
    let headers = new HttpHeaders();
    headers.append("Content-Type", "application/json");
    return this.http
      .delete&lt;Show&gt;(`${environment.apiBase}/shows/${showId}`, {
        headers
      })
      .pipe(catchError(this.handleError));
  }
</code></pre>

<p>Backend Code:</p>

<p>Route:</p>

<pre><code>func RouteShows(r *mux.Router, shows handlers.ShowHandler) {

    sub := r.PathPrefix("/api/shows").Subrouter()

    sub.HandleFunc("", getShows(shows)).Methods(http.MethodGet)
    sub.HandleFunc("/{id}", getShowById(shows)).Methods(http.MethodGet)
    sub.HandleFunc("/{id}", updateShow(shows)).Methods(http.MethodPut)
    sub.HandleFunc("", createShow(shows)).Methods(http.MethodPost)
    sub.HandleFunc("/{id}", deleteShow(shows)).Methods(http.MethodDelete)
    sub.HandleFunc("/status/{status}", getShowsByStatus(shows)).Methods(http.MethodGet)
}
</code></pre>

<hr>

<p>API func:</p>

<pre><code>func deleteShow(s handlers.ShowHandler) http.HandlerFunc {

    return func(w http.ResponseWriter, r *http.Request) {

        params := mux.Vars(r)
        var show models.Show

        if _, ok := params["id"]; !ok {
            responses.BadRequestWrapped(w, errors.New("param not found: id"))
            return
        }

        err := s.DeleteShow(params["id"])
        if err != nil {
            responses.InternalServerErrorWrapped(w, errors.FromError(err)) //TODO
            return
        }

        responses.OK(w, show)
    }

}
</code></pre>

<hr>

<p>MongoHandler interface:</p>

<pre><code>//ShowHandler handles the interface of mongo func
type ShowHandler interface {
    SearchShows(values map[string][]string, pagination *models.Pagination) ([]*models.Show, error)
    GetShows() ([]*models.Show, error)
    GetShowById(id string) (*models.Show, error)
    //GetAppointmentsCreatedByUser(username string) ([]*models.Appointment, error)
    GetShowsByStatus(status string) ([]*models.Show, error)

    CreateShow(show *models.Show) error
    UpdateShow(show *models.Show) error
    DeleteShow(id string) error
}
</code></pre>

<hr>

<p>Mongo Handler:</p>

<pre><code>//deleteShow removes a show based on Show ID from DB
func (s *shows) DeleteShow(id string) error {

    if _, err := s.mongo.DeleteOne(db_qcq, collection_shows, ValueEquals("_id", id)); err != nil {
        return err
    }

    return nil
}
</code></pre>

<p>Hope this is enough to give perspective.</p>

