Select latest document after grouping them by a field in MongoDB<p>I got a question that I would expect to be pretty simple, but I cannot figure it out. What I want to do is this:</p>

<ul>
<li>Find all documents in a collection and:

<ul>
<li>sort the documents by a certain date field</li>
<li>apply <code>distinct</code> on one of its other fields, <strong>but return the whole document</strong></li>
</ul></li>
</ul>

<p>Best shown in an example. </p>

<h3>This is a mock input:</h3>

<pre><code>[
  {
    "commandName" : "migration_a",
    "executionDate" : ISODate("1998-11-04T18:46:14.000Z")
  },
  {
    "commandName" : "migration_a",
    "executionDate" : ISODate("1970-05-09T20:16:37.000Z")
  },
  {
    "commandName" : "migration_a",
    "executionDate" : ISODate("2005-11-08T11:58:52.000Z")
  },
  {
    "commandName" : "migration_b",
    "executionDate" : ISODate("2016-06-02T19:48:34.000Z")
  }
]

</code></pre>

<h3>The expected output is:</h3>

<pre><code>[
  {
    "commandName" : "migration_a",
    "executionDate" : ISODate("2005-11-08T11:58:52.000Z")
  },
  {
    "commandName" : "migration_b",
    "executionDate" : ISODate("2016-06-02T19:48:34.000Z")
  }
]
</code></pre>

<p>Or, in other words:</p>

<ul>
<li>Group the input data by the <code>commandName</code> field</li>
<li><em>Inside each group</em> sort the documents</li>
<li>Return the newest document <em>from each group</em></li>
</ul>

<hr>

<p>My attempts to write this query have failed:</p>

<ul>
<li><p>The <code>distinct()</code> function will only return the value of the field I am distinct-ing on, not the whole document. That makes it unsuitable for my case.</p></li>
<li><p>Tried writing an <code>aggregate</code> query, but ran into an issue of how to sort-and-select a single document from inside of each group? The <code>sort</code> aggreation stage will sort the <code>groups</code> among one other, which is not what I want.</p></li>
</ul>

<p>I am not too well-versed in Mongo and this is where I hit a wall. Any ideas on how to continue?</p>

<hr>

<p>For reference, this is the work-in-progress aggregation query I am trying to expand on:</p>

<pre><code>db.getCollection('some_collection').aggregate([
{ $group: { '_id': '$commandName', 'docs': {$addToSet: '$$ROOT'} } }, 
{ $sort: {'_id.docs.???': 1}}
])
</code></pre>

<hr>

<p><strong>Post-resolved edit</strong></p>

<p>Thank you for the answers. I got what I needed. For future reference, this is the full query that will do what was requested <em>and also return a list of the filtered documents, not groups</em>.</p>

<pre><code>db.getCollection('some_collection').aggregate([
{ $sort: {'executionDate': 1}},
{ $group: { '_id': '$commandName', 'result': { $last: '$$ROOT'} } },
{ $replaceRoot: {newRoot: '$result'} }
])
</code></pre>

<p>The query result <em>without</em> the <code>$replaceRoot</code> stage would be:</p>

<pre><code>[
  {
    "_id": "migration_a",
    "result": {
      "commandName" : "migration_a",
      "executionDate" : ISODate("2005-11-08T11:58:52.000Z")
    }
  },
  {
    "_id": "migration_b",
    "result": {
      "commandName" : "migration_b",
      "executionDate" : ISODate("2016-06-02T19:48:34.000Z")
    }
  }
]
</code></pre>

<p>The outer <code>_id</code> and <code>_result</code> are just "group-wrappers" around the actual document I want, which is nested under the <code>result</code> key. Moving the nested document to the root of the result is done using the <code>$replaceRoot</code> stage. The query result when using that stage is:</p>

<pre><code>[
  {
    "commandName" : "migration_a",
    "executionDate" : ISODate("2005-11-08T11:58:52.000Z")
  },
  {
    "commandName" : "migration_b",
    "executionDate" : ISODate("2016-06-02T19:48:34.000Z")
  }
]
</code></pre>

